import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

let rootElement;
if (typeof window !== "undefined") {
  rootElement = document.getElementById('root');
}

// if (typeof window === 'object') {
//   rootElement = document.getElementById('root');
// }

if (rootElement) {
  const root = ReactDOM.createRoot(rootElement);
  root.render(<App />);
}
